import React from "react";
import { FaFootballBall } from "react-icons/fa";
import './NavBar.css';
import { Link } from "react-router-dom";

function NavBar() {
  return (
    <>   
      <nav className="navbar">
        <div className="navbar-logo">
          <FaFootballBall />
        </div>
        
        <ul className="navbar_search_opts">
          <li><Link to="/searchpages/seasonSearch">Season</Link></li>
          <li><Link to="/searchTeam">Team</Link></li>
          <li><Link to="/searchPlayer">Player</Link></li>
          <li><Link to="/searchPosition">Position</Link></li>
        </ul>
      </nav>
    </>
  );
} 

export default NavBar;
